import React, { Component } from 'react'
import axios from 'axios';

export default class ListMembers extends Component {
    constructor(props) {
        super(props)
        this.state = {members :[]}
    }
    componentDidMount() {
        axios.get(`http://localhost:8092/familytree/member`)
          .then(response => {
            console.log(response.data);
            this.setState({members:response.data})
          }).catch(error =>{
              console.log(error);
          });
      }
      
      render() {
          return (
          <div>
              <h2>List of Membersss</h2>
              <ul>
                {this.state.members.map(member => <div key={member.id}>{member.id} - {member.firstName}   {member.lastName} a.k.a {member.nickName}</div>)}
                </ul>
            </div>
          )
        }
}
